window.customElements.define("my-counter",class extends HTMLElement{connectedCallback(){const s=this.querySelector("template");s.replaceWith(s.content);const o=this.querySelector("button[aria-label=increment]"),i=this.querySelector("button[aria-label=decrement]"),n=this.querySelector("output"),t=this.querySelector("input");let e=parseInt(n.innerText);o.addEventListener("click",()=>{t.max>e&&e++,n.innerText=e,t.value=e}),i.addEventListener("click",()=>{t.min<e&&e--,n.innerText=e,t.value=e})}})